import React from "react";
import "../index.scss";



const AllRecipies = ({ setOne, changeView, data }) => {
  console.log(data);
  return (
    <div className="card-container">
      <div>
     
        {data.map((recipe, i) => (
          <div
          >
            <img src={recipe.recepie_Image} alt={recipe.recepie_Name} />
            <p>{recipe.name}</p>
            <p>{recipe.price} </p>
          </div>
        ))}
      </div>
    </div>
    
  );
};

export default AllRecipies;
